node {
    TimeMs lastUpdateTime;

    void evaluate(Context ctx) {
        bool enabled = getValue<input_EN>(ctx);
        bool update = isInputDirty<input_UPD>(ctx);
        bool reset = isInputDirty<input_RST>(ctx);

        TimeMs t = transactionTime();
        if (reset)
            emitValue<output_OUT>(ctx, 0);
        else if (enabled && update) {
            Number dtSeconds = (t - lastUpdateTime);
            Number oldSeconds = getValue<output_OUT>(ctx);
            emitValue<output_OUT>(ctx, oldSeconds + dtSeconds);
        }

        lastUpdateTime = t;
    }
}

struct State {
};

{{ GENERATED_CODE }}

void evaluate(Context ctx) {
    auto stepPort = getValue<input_STEP>(ctx);
    auto dirPort = getValue<input_DIR>(ctx);
    auto nSteps = getValue<input_N>(ctx);
    auto pps = getValue<input_PPS>(ctx);

    if (isInputDirty<input_RST>(ctx)) {
        noTone(stepPort);
        clearTimeout(ctx);
        return;
    }

    if (isTimedOut(ctx)) {
        emitValue<output_DONE>(ctx, 1);
    }

    if (!isInputDirty<input_GO>(ctx)) {
        return;
    }

    if (pps == 0) {
        emitValue<output_ERR>(ctx, 1);
        return;
    }

    if (pps < 0) {
        // swap direction if PPS is negative
        pps = -pps;
        nSteps = -nSteps;
    }

    // In case the in-progress rotation is finite and the upcoming
    // one will be infinite
    clearTimeout(ctx);

    pinMode(stepPort, OUTPUT);
    pinMode(dirPort, OUTPUT);
    digitalWrite(dirPort, nSteps < 0);

    if (isfinite(nSteps)) {
        unsigned long durationMs = abs(nSteps) / pps * 1000;
        tone(stepPort, pps, durationMs);
        setTimeout(ctx, durationMs);
    } else {
        tone(stepPort, pps);
    }
}
